// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="page">

      <header className="header">
          <div className="header__container">
            <a href="/" className="header__logo">NewsExplorer</a>
            <nav className="header-navigation">
              <a href="/" className="header-navigation__link header-navigation__link_active_black">Главная</a>
              <button className="header-navigation__button">Авторизоваться</button>
            </nav>
            <button className="header__burger-menu-button"></button>
          </div>
        </header>


    </div>
  );
}

export default App;
